import "./NavBar.scss";
import Scroll from "react-scroll";

const Link: any = Scroll.ScrollLink;

const NavBar = () => {
  return (
    <nav className="nav">
      <Link
        to="landingPage"
        spy={true}
        smooth={true}
        duration={400}
        className="nav"
        activeClass="active-nav"
      >
        Home
      </Link>
      <Link>About</Link>
      <li>Work</li>
      <li>Contact</li>
    </nav>
  );
};

export default NavBar;
